def predict_subscription_plan(purchase_history):
    """"""
    weights = {'item_type': 0.4, 'quantity': 0.3, 'time_since_purchase': 0.2, 'cost': 0.1}
    item_type_score = sum([1 for item in purchase_history.keys() if item == 'premium'])
    quantity_score = sum(purchase_history.values())
    time_since_purchase_score = 1
    cost_score = sum([10 for item in purchase_history.keys() if item == 'premium'])
    total_score = weights['item_type'] * item_type_score + weights['quantity'] * quantity_score + weights['time_since_purchase'] * time_since_purchase_score + weights['cost'] * cost_score
    if total_score > 10:
        return 'Premium'
    elif total_score > 5:
        return 'Basic'
    else:
        return 'Free'
